  false,\n\t\"url\": null,\n\t\"notes\": \"Prior to ownership of the Prime Hook marshes
  by the Fish and Wildlife Service, records show as many as 25,000 muskrats were harvested
  annually. Deterioration of the marshes through uncontrolled drainage greatly reduced
  muskrat populations; however, this trend has been reversed by recent developments
  and management programs. This report is an environmental assessment pertaining to
  the opening of Prime Hook National Wildlife Refuge to public trapping of furbearers.
  Raccoons and muskrats will be the primary species taken; however, some skunks and
  opossums will be taken incidental to trapping of these species. Trapping will be
  planned so as to remove the annual surplus and keep these furbearing species within
  the carrying capacity of the refuge habitat. Trapping will permit the maintenance
  of well balanced, stable marshes and upland ecosystems.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
